import styled from "styled-components";

const NAV_WIDTH = "210px";

export const NavContainer = styled.nav`
  display: flex;
  flex: 0 1 ${NAV_WIDTH};
  flex-direction: column;
  align-items: center;
  margin: 30px 0;
`;
